pragma solidity ^0.4.18;

import './ENS.sol';

/**
 * A registrar that allocates subdomains to the first person to claim them.
 */
contract FixedPriceRegistrar {
    ENS ens;

    bytes32 rootNode;

    address public owner;    
    uint256 public price;

    event PriceChanged(uint256 price);
    event OwnerChanged(address owner);
    event Widthdraw(address to, uint256 amount);

    modifier only_owner() {
        require(owner == msg.sender);
        _;
    }

    modifier only_available_node(bytes32 subnode) {
        address nodeOwner = ens.owner(keccak256(rootNode, subnode));
        require(nodeOwner == 0);
        _;
    }

    modifier only_node_owner(bytes32 subnode) {
        address nodeOwner = ens.owner(keccak256(rootNode, subnode));
        require(nodeOwner == msg.sender);
        _;
    }

    /**
     * Constructor.
     * @param ensAddr The address of the ENS registry.
     * @param node The node that this registrar administers.
     */
    function FixedPriceRegistrar(ENS ensAddr, bytes32 node) public {
        ens = ensAddr;
        rootNode = node;
        owner = msg.sender;
    }

    /**
    * Sets new fixed price for name
    * @param newPrice New price of node purchase
    */
    function setPrice(uint256 newPrice) public only_owner {
        price = newPrice;
        emit PriceChanged(price);
    }

    /**
    * Sets new contract owner
    * @param newOwner New owner
    */
    function setOwner(address newOwner) public only_owner {
        owner = newOwner;
        emit OwnerChanged(owner);
    }

    /**
    * Widthdraw contract funds
    * @param to Address widthdraw to
    * @param amount Amount to widthdraw
    */
    function widthdraw(address to, uint256 amount) public only_owner {
        require((amount > 0) && (amount <= address(this).balance));

        to.transfer(amount);
        emit Widthdraw(to, amount);
    }

    /**
     * Register new name
     * @param node The hash of the label to register.
     */
    function buy(bytes32 node) public payable only_available_node(node) {
        require(msg.value >= price);
        ens.setSubnodeOwner(rootNode, node, msg.sender);
    }

    /**
     * Change the owner of an existing registration.
     * @param node The hash of the label to register.
     * @param nodeOwner The address of the new owner.
     */
    function transfer(bytes32 node, address nodeOwner) public only_node_owner(node) {
        ens.setSubnodeOwner(rootNode, node, nodeOwner);
    }

    // Fallback function to accept ETH into contract.
    function () public payable { }

    function destroy() public only_owner {
        selfdestruct(owner);
    }
}

